import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
KBarProvider, KBarPortal, KBarPositioner, KBarAnimator, KBarSearch, KBarResults;
import "bootstrap/dist/css/bootstrap.css";

const actions = [
  {
    id: "home",
    name: "Home",
    shortcut: ["h"],
    keywords: "home",
    perform: () => (window.location.pathname = "/"),
  },
  {
    id: "projects",
    name: "Projects",
    shortcut: ["p"],
    keywords: "project",
    perform: () => (window.location.pathname = "projects"),
  },
  {
    id: "about",
    name: "About",
    shortcut: ["a"],
    keywords: "about",
    perform: () => (window.location.pathname = "about"),
  },
];

ReactDOM.render(
  <KBarProvider actions={actions}>
    <KBarPortal>
      {" "}
      // Renders the content outside the root node
      <KBarPositioner>
        {" "}
        // Centers the content
        <KBarAnimator>
          {" "}
          // Handles the show/hide and height animations
          <KBarSearch /> // Search input
          <KBarResults /> // Results renderer
        </KBarAnimator>
      </KBarPositioner>
    </KBarPortal>
    <App />
  </KBarProvider>,
  document.getElementById("root")
);
